  false,\n\t\"url\": null,\n\t\"notes\": \"The Chautauqua National Wildlife Refuge
  Law Enforcement Plan clarifies U.S. Fish and Wildlife enforcement policies as they
  apply to the Refuge. It provides information about problems, responsibilities, procedures,
  and situations. Specific topics include: demeanor, enforcement authority and jurisdiction,
  chain of command, patrol procedure, responsibility for and use of equipment, violations,
  warnings, searches, seizures, complaints and arrests, emergency procedures, drugs,
  and firearms policy.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
